import React from "react";

const Table = ({ matrix }) => {
   const rows = matrix.map((row, index) => {
      console.log(row)
      return <tr key={index}><td>{row.value}</td></tr>;
   });
   return (
      <table>
         <tbody>{rows}</tbody>
      </table>
   );
};

export default Table;
